import React , {Component} from 'react';

class BoardView extends Component{
    constructor(props){
        super(props);
        this.state = {
            id:this.props.match.params.id,
        }

    }
    render(){
        return(
            <div>
                BoardView {this.props.id}
            </div>
        )
    }
}

export default BoardView;
